import {Link} from "react-router-dom";

const DUMMY_EVENTS = [
 {id: "event1", content: "event1"},
 {id: "event2", content: "event2"},
 {id: "event3", content: "event3"},
 {id: "event4", content: "event4"},
]
const Events = () => {
 return <>
  <ul>
   {DUMMY_EVENTS.map((event) =>
    (<li key={event.id}>
     <Link to={event.id}>{event.content}</Link>
    </li>))
   }
  </ul>
 </>
}

export default Events;
